import React from 'react';
import Home from './Home.js'
import { Button, Icon } from 'react-materialize';
import './App.css';

class App extends React.Component {
  render(){
  return (
    <div className="App">
     <Button
        floating
        fab={{direction: 'bottom'}}
        className="red"
        large
        style={{top: '50px'}}>

      <Button floating icon={<Icon medium clo/>} className="red" />
      <Button floating icon={<Icon />} className="yellow darken-1" />
      <Button floating icon={<Icon />} className="green" />
      <Button floating icon={<Icon />} className="blue" />
</Button>
     <Home/>
    </div>
  );
  }
}

export default App;
